import Layout from '../components/Layout';
import Link from 'next/link';
import http from '../http';
import Head from 'next/head'

const Index = (props) => (
    <div className="homeWrap">
        <Head>
            <title>首页</title>
        </Head>
            <div className="homeLeft">
                <ul>
                    <li>
                        <div className="articleTitle">标题标题标题标题标题标题标题</div>
                        <div className="articleTxt">描述描述描述描述</div>
                    </li>
                </ul>
            </div>
            <div className="homeRight">
                <div className="visitorList">
                    <div className="visitorTitle">
                        访客列表 
                    </div>
                    <ul>
                        <li  className="visitorInfo">
                            <span>190.168.0.1</span>
                            <span>2020-01-01 10:10:20</span>
                        </li>
                        <li  className="visitorInfo">
                            <span>190.168.0.1</span>
                            <span>2020-01-01 10:10:20</span>
                        </li>
                        <li  className="visitorInfo">
                            <span>190.168.0.1</span>
                            <span>2020-01-01 10:10:20</span>
                        </li>
                        <li  className="visitorInfo">
                            <span>190.168.0.1</span>
                            <span>2020-01-01 10:10:20</span>
                        </li>
                    </ul>
                </div>
                <div className="visitorList">
                    <div className="visitorTitle">
                        留言列表 
                    </div>
                    <ul>
                        <li  className="visitorInfo">
                            <span>加油</span>
                            <span>2020-01-01 10:10:20</span>
                        </li>
                        <li  className="visitorInfo">
                            <span>干啥呢老哥</span>
                            <span>2020-01-01 10:10:20</span>
                        </li>
                        <li  className="visitorInfo">
                            <span>来了老弟</span>
                            <span>2020-01-01 10:10:20</span>
                        </li>
                        <li  className="visitorInfo">
                            <span>加油</span>
                            <span>2020-01-01 10:10:20</span>
                        </li>
                    </ul>
                </div>
            </div>
        <style jsx>
        {`
            .homeWrap{
                display: flex;
                max-width: 1200px;
                width: 1200px;
                padding: 20px 0;
                margin:0 auto;
            }
            .homeLeft{
                width: 800px;
                padding: 20px;
            }
            .articleTitle{
                color: #333333;
                font-size: 18px;
                line-height: 30px;
                cursor: pointer;
            }
            .articleTxt{
                font-size: 14px;
                color: #999999;
                line-height: 30px;
                cursor: pointer;
            }
            .homeRight{
                padding: 20px;
            }
            .visitorList{
                padding-bottom:20px;
                border-bottom:1px solid #cccccc;
                margin-bottom: 20px;
            }
            .homeRight .visitorList li{
                margin-bottom: 5px;
            }
            .visitorTitle{
                font-size: 12px;
                color: #333333;
                margin-bottom: 10px;
            }
            .visitorInfo span{
                font-size: 12px;
                color: #666666;
                margin-right: 10px;
            }
        `}
        </style>
    </div>
);

Index.getInitialProps = async () => {
    const data = await http({ url: '/sort/getSortList', method: 'get' , params: {}})
    return {
        sortList: data.data
    }
}

export default Index;
